adress: {
    gata: String,
    postkod: Number,
    stad: String
},

kontakt: {
    email: String,
    telefon: Number,
},

company: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Company'
},

notering: [{
    type: String,
}],

lan: [{
