MongoDB add to joining collection field from base one<p>I have two collections:</p>

<p>Games with schema:</p>

<pre><code> _id: ObjectId('gameId'),
 questions: [
   {
     position: 1,
     question_id: ObjectId('baz')
   },
   {
     position: 2,
     question_id: ObjectId('ban')
   },
 ]
</code></pre>

<p>Questions with schema:</p>

<pre><code> _id: ObjectId('baz'),
 text: 'FooBar'
</code></pre>

<p>And now I'd like to join questions to games with adding to each question record value of <code>question_position</code>.</p>

<p>So, I have query like this:</p>

<pre><code>db.games.aggregate([
    {
      $lookup: {
        from: 'questions',       
        localField: 'questions.question_id',
        foreignField: '_id',       
        as: 'question_data',     
      },   
     }])
</code></pre>

<p>Which return me all required info, with correct join according to questions array, </p>

<pre><code> _id: ObjectId('gameId'),
 questions: [
   {
     position: 1,
     question_id: ObjectId('baz')
   },
   {
     position: 2,
     question_id: ObjectId('ban')
   }
 ],
 question_data: [
   {
     _id: ObjectId('baz'),
     text: 'FooBar',
   },
   {
     _id: ObjectId('ban'),
     text: 'FooBar2',
   }
 ]
</code></pre>

<p>but I'm totally can't figure out how to add into joined questions it's position according to game.
To look it like this:</p>

<pre><code> _id: ObjectId('gameId'),
 questions: [
   {
     position: 1,
     question_id: ObjectId('baz')
   },
   {
     position: 2,
     question_id: ObjectId('ban')
   }
 ],
 question_data: [
   {
     _id: ObjectId('baz'),
     text: 'FooBar',
     position: 1,
   },
   {
     _id: ObjectId('ban'),
     text: 'FooBar2',
     position: 2,
   }
 ]
</code></pre>

<p><br>
I've tried with <code>$unwind</code> for question array in game collection, played a little with <code>$project</code> in <code>aggregation</code> but still no result.<br></p>

<p><strong>So</strong>, my question is, how to add field from base collection to joined data from another collection</p>

