JavaScript not assigning an element to the object<pre><code>const allocation_me = async (request, response) =&gt; {
  try {
    const { user: userid } = request;
    if (!ObjectId.isValid(userid)) throw new Error('invalid objectid');

    const now = moment().format();
    const date = new Date(now);
    const allocation = await Allocation.findOne({ $and: [{ user: userid, start_date: { $lt: date }, end_date: { $gt: date } }] })
      .populate('user', 'name')
      .populate('garden');
    if (!allocation) throw new Error('invalid request');
    allocation.timestamp = moment(allocation.end_date).format('x');
    response.status(200).send(allocation);
  } catch (error) {
    response.status(400).send(error);
  }
};
</code></pre>

<p>I'm trying to add the timestamp to the object that is returned by the mongo query but when it sends the allocation as the response, the timestamp doesn't show up. I've tried to log the allocation.timestamp value and it doesn't show either, it's like javascript is ignoring me assigning it. I've tried changing from const to let but apparently that's not the issue.</p>

