<pre><code>export class ProductTypeModel {
    _id: ObjectID;
    name: string;
    children: {
        _id: ObjectID,
        name: string,
        icon: string
    }[];
}
</code></pre>

<p>It represents the product types in my application. Actually the <code>children</code> has almost the same properties with base model, except it has an extra <code>icon</code> property.</p>

<p>Now I have data like this:</p>

<pre><code>{ 
    "_id" : ObjectId("5b9378d9a842a7557223ebfa"), 
    "name" : "Clothes", 
    "children" : [ { 
        "_id" : ObjectId("5b9378d9a842a7557223ebf6"), 
        "name" : "Men", 
        "icon": "xxx"
    }, { 
        "_id" : ObjectId("5b9378d9a842a7557223ebf7"), 
